void ttsMaker(void){
	//LED_BlueToggle();
	if(TTS_Button){
		// Handle what goes into Systick timer and dac_out
		NVIC_ST_RELOAD_R = 7256; //11025 Hz
		phoneme = findPhoneme(removeFromFifo());
		idx = 0;
	}
}
void SysTick_Handler(void){
  //DAC_Out(Trumpet64[idx&0x3F] * 10 / factor);
	//LED_BlueToggle();
	if(TTS_Button == 0){
		DAC_Out(outArray[idx&0x3F] * factor);
		if(env > duration){
			factor = envelope[envI++];
			env = 0;
		}
		idx++;
		env++;
	}
	else{
		if(idx >= size){
			ttsMaker();
		}
		DAC_Out(phoneme[idx]);
		idx++;
	}
}

void songMaker(void){
	//LED_BlueToggle();
	if(PP_Button){
		// Handle what goes into Systick timer and dac_out
		NVIC_ST_RELOAD_R = song.note[curNote];
		TIMER0_TAILR_R = song.duration[curNote] * SONG_TEMPO;
		duration = song.duration[curNote] * SONG_TEMPO / 12;
		duration /= song.note[curNote];
		if(curNote < 71)
			curNote++;
		else
			curNote = 0;													
		idx = 0;
		env = 0;
		envI = 0;
	}
}
