volatile int rPower = 0;
volatile int lPower = 0;
volatile int powerSet = 0;
volatile int powerAngle = 0;
volatile int pseudoTime = 0;
void motorControl(){
		powerSet = ((instructionBuffer[7] - 0x30) * 100) + (instructionBuffer[9] - 0x30) * 10 + (instructionBuffer[10] - 0x30);
		powerAngle = ((instructionBuffer[11] - 0x30) * 100) + (instructionBuffer[12] - 0x30) * 10 + (instructionBuffer[13] - 0x30);
		
		if(LED_Button){
			pseudoTime++;
		}
		switch(powerAngle / 45){
			case 0:
				if(powerSet != 0 && LED_Button){
					LED_LeftOn();
					if((pseudoTime > 30) && LED_Button){
						LED_RightToggle();
						pseudoTime = 0;
					}
				}
				else{
					LED_LeftOff();
					LED_RightOff();
					
				}
				lPower = powerSet;
				rPower = (powerSet * (45 - powerAngle))/45; 			// 100 -> 0
				break;
			case 1:
				if(LED_Button){
					LED_LeftOn();
				}
				if((pseudoTime > 30) && LED_Button){
					LED_RightToggle();
					pseudoTime = 0;
				}
				lPower = powerSet;
				rPower = -1 * (powerSet * (powerAngle - 45))/45; 	// 0 -> -100
				break;
			case 2:
				lPower = (powerSet * (135 - powerAngle))/45; 			// 100 -> 0 
				rPower = -1 * powerSet;
				break;
			case 3:
				lPower = -1 * (powerSet * (powerAngle - 135))/45; // 0 -> -100
				rPower = -1 * powerSet;
				break;
			case 4:
				lPower = -1 * powerSet;
				rPower = -1 * (powerSet * (225 - powerAngle))/45;	// -100 -> 0 													
				break;
			case 5: 
				lPower = -1 * powerSet;
				rPower = (powerSet * (powerAngle - 225))/45;			// 0 -> 100 													
				break;
			case 6:
				if(LED_Button){
					LED_RightOn();
				}
				if((pseudoTime > 30) && LED_Button){
					LED_LeftToggle();
					pseudoTime = 0;
				}
				lPower = -1 * (powerSet * (315 - powerAngle))/45;	// -100 -> 0
				rPower = powerSet; 																
				break;
			case 7:
				if(LED_Button){
					LED_RightOn();
				}
				if((pseudoTime > 30) && LED_Button){
					LED_LeftToggle();
					pseudoTime = 0;
				}
				lPower = (powerSet * (powerAngle - 315))/45;			// 0 -> 100
				rPower = powerSet; 																
				break;
			default:
				break;
		}
		//Going backwards
		if(lPower < 0){
			Left_DutyB(lPower * -120, 1);
		}
		else{
			Left_DutyB(lPower * 120, 0);
		}
		// Going backwards
		if(rPower < 0){
			Right_DutyB(rPower * -120, 0);
		}
		else{
			Right_DutyB(rPower * 120, 1);
		}
}

volatile short lastP = 0;
volatile short messageCount = 0;
volatile short messageIndex = 0;
volatile short lineIndex = 5;
void setRobotStatus(){
		// Display is triggered off global flag updates
	
		ST7735_SetCursor(0,0);
		// Button 1 is pressed
		if(instructionBuffer[2] == '1'){
			ST7735_OutChar('1');
			if(PP_Button == 0){
				PP_Button = 1;
				TIMER0_CTL_R = 0x00000001;    // 10) enable TIMER0A
				NVIC_ST_CTRL_R |= 0x02;
				songMaker();
			}
		}
		else{
			ST7735_OutChar('0');
			if(PP_Button == 1){
				PP_Button = 0;
				TIMER0_CTL_R = 0x00000000;    // 10) disable TIMER0A
				NVIC_ST_CTRL_R &= ~0x02;
				songMaker();
			}
		}
		ST7735_SetCursor(0,1);
		// Button 2 is pressed
		if(instructionBuffer[4] == '1'){
			ST7735_OutChar('1');
			if(LED_Button == 0){
				LED_Button = 1;
				LED_LeftOn();
				LED_RightOn();
			}
		}
		else{
			ST7735_OutChar('0');
			if(LED_Button){
				LED_Button = 0;
				LED_LeftOff();
				LED_RightOff();
			}
		}
		
		ST7735_SetCursor(0,2);
		// Button 3 is pressed
		if(instructionBuffer[6] == '1'){
			if(TTS_Button == 0){
				TIMER0_CTL_R = 0x00000000;    // 10) disable TIMER0A
				NVIC_ST_CTRL_R &= ~0x02;
				TTS_Button = 1;
				fifoClear();
				ttsMaker();
				NVIC_ST_CTRL_R |= 0x02;
			}
			ST7735_OutChar('1');
			if(messageIndex > 19){
				messageIndex = 0;
				lineIndex++;
			}
			ST7735_SetCursor(messageIndex, lineIndex);
			if(instructionBuffer[14] != 0){ //5 for phonemes
				if(messageCount == 0){
					messageCount++;
				}
				else{
					if(instructionBuffer[5] != 0){
						addToFifo(instructionBuffer[5]);
						lastP = 1;
						//ST7735_OutChar(instructionBuffer[5]);
					}
					////////
					else if (lastP == 1){
						lastP = 0;
						//remove back of fifo
						fifoTail--;
						
					}		
					////////
					ST7735_OutChar(instructionBuffer[14]); //5 for phonemes
					messageIndex++;
					messageCount = 0;
				}
			}

		}
		else{
			if(TTS_Button == 1){
				TTS_Button = 0;
				if(PP_Button == 1){
					TIMER0_CTL_R = 0x00000001;    // 10) enable TIMER0A
					NVIC_ST_CTRL_R |= 0x02;
					songMaker();
				}
				else{
					TIMER0_CTL_R = 0x00000000;    // 10) disable TIMER0A
					NVIC_ST_CTRL_R &= ~0x02;
				}			
			}
			if(messageIndex != 0 || lineIndex != 0){
				ST7735_FillRect(0, 50, 120, 10 * (lineIndex - 4), ST7735_BLACK);
				lineIndex = 5;
				messageIndex = 0;
				messageCount = 0;
			}
			ST7735_OutChar('0');
		}
		ST7735_SetCursor(0,3);
		//Output power of joystick
		ST7735_OutChar(instructionBuffer[7]);
		ST7735_OutChar(instructionBuffer[8]);
		ST7735_OutChar(instructionBuffer[9]);
		ST7735_OutChar(instructionBuffer[10]);
		
		
		//Output angle of joystick
		ST7735_SetCursor(0,4);
		ST7735_OutChar(instructionBuffer[11]);
		ST7735_OutChar(instructionBuffer[12]);
		ST7735_OutChar(instructionBuffer[13]);
		
		// Update motors based on instructions
		motorControl();
		
		processBuff = 0;
}

